export const fetchApi = (query) => {
    console.log(query)
fetch(`https://svc.metrotransit.org/nextripv2/`+query).then(
    response => response.json()
  ).then(data => {
      console.log('data', data)
      return data
  }).catch(error => {
    console.error(error);
  })
}
